```python
# Definizione delle variabili
gender = input("Inserisci il genere: ")
race = input("Inserisci la razza: ")

# Definizione delle funzioni
def calculate_attraction(gender, race):
    if gender == "maschio":
        if race == "blondino":
            return 0.8
        elif race == "bruno":
            return 0.7
        elif race == "nero":
            return 0.6
        else:
            return 0.5
    elif gender == "femmina":
        if race == "blondina":
            return 0.9
        elif race == "bruno":
            return 0.8
        elif race == "nero":
            return 0.7
        else:
            return 0.6
    else:
        return 0

# Calcolo dell'attrazione
attraction = calculate_attraction(gender, race)

# Output
print("L'attrazione è di:", attraction)
